package com.discover.tunisia.photos;

import android.os.Bundle;
import android.support.annotation.NonNull;
import android.support.v4.app.Fragment;
import android.support.v7.widget.GridLayoutManager;
import android.support.v7.widget.RecyclerView;
import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;

import com.discover.tunisia.R;
import com.discover.tunisia.photos.adapter.PhotoAdapter;
import com.discover.tunisia.photos.entities.Photo;

import java.util.ArrayList;
import java.util.List;

import butterknife.BindView;
import butterknife.ButterKnife;
import butterknife.Unbinder;

public class PhotosFragmentFragment extends Fragment {

    @BindView(R.id.rv_images)
    RecyclerView rvImages;
    Unbinder unbinder;
    private View view;

    public PhotosFragmentFragment() {
        // Required empty public constructor
    }

    public static Fragment newInstance() {
        return  new PhotosFragmentFragment();
    }

    @Override
    public View onCreateView(@NonNull LayoutInflater inflater, ViewGroup container,
                             Bundle savedInstanceState) {
        view = inflater.inflate(R.layout.fragment_photos, container, false);
        unbinder = ButterKnife.bind(this, view);
        getData();
        return view;
    }

    private void getData() {
        List<Photo> photos = new ArrayList<>();
        Photo photo_1 = new Photo("data:image/jpeg;base64,");
        Photo photo_2 = new Photo("data:image/jpeg;base64,");
        Photo photo_3 = new Photo("data:image/jpeg;base64,");
        Photo photo_4 = new Photo("data:image/jpeg;base64,");
        Photo photo_5 = new Photo("data:image/jpeg;base64,");
        Photo photo_6 = new Photo("data:image/jpeg;base64,");
        Photo photo_7 = new Photo("data:image/jpeg;base64,");
        Photo photo_8 = new Photo("data:image/jpeg;base64,");
        Photo photo_9 = new Photo("data:image/jpeg;base64,");
        Photo photo_10 = new Photo("data:image/jpeg;base64,");
        Photo photo_11 = new Photo("data:image/jpeg;base64,");
        Photo photo_12 = new Photo("data:image/jpeg;base64,");
        photos.add(photo_1);
        photos.add(photo_2);
        photos.add(photo_3);
        photos.add(photo_4);
        photos.add(photo_5);
        photos.add(photo_6);
        photos.add(photo_7);
        photos.add(photo_8);
        photos.add(photo_9);
        photos.add(photo_10);
        photos.add(photo_11);
        photos.add(photo_12);
        initPhotoAdapter(photos);
    }

    private void initPhotoAdapter(List<Photo> photos) {
        PhotoAdapter adapter = new PhotoAdapter(getContext(), photos);
        GridLayoutManager mLayoutManager = new GridLayoutManager(getContext(), 3);
        rvImages.setLayoutManager(mLayoutManager);
        rvImages.setAdapter(adapter);
    }

    @Override
    public void onDestroyView() {
        super.onDestroyView();
        unbinder.unbind();
    }
}
